// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

/// @custom:dev-run-script ./scripts/deploy_with_ethers.ts
contract AdivinaNumero {
    address private jugador;
    uint premio;
    uint numeroAleatorio;

    // almacen los registros dentro de la blockchain, como transacción y son accesibles con la dirección del contrato una vez esté presente en la blockchain
    event Numero(uint randomnumber, uint numeroAdivinado, uint premio);

    /**
     * payable porque en caso de ser positiva permite cobrar
     * @dev Constructor que inicializa el número aleatorio

     * Toma módulo %10 porque quiere que sea del 1 al 10
     * 
     */
    function adivina(uint numeroAdivinado) public payable {
        // Enetero sin signo, utiliza la función hash del último blocke generado en la blockchain
        uint randomnumber = (uint(
            keccak256(abi.encodePacked(block.timestamp, msg.sender))
        ) % 10) + 1;

        if (numeroAdivinado == randomnumber) {
            jugador = msg.sender;
            premio = 1000000000000000000; // Premio es un Ether
        }

        // Registrar la transacción en la blockchain
        emit Numero(randomnumber, numeroAdivinado, premio);
    }
}

